(168, 1, '2017-05-31 20:03:50', 'Community Edition 1.9.3.3 and SUPEE-9767 Security Enhancements – 5/31/2017', 'Community Edition 1.9.3.3 and SUPEE-9767 includes critical security enhancements. Review the Security Center update for more information: https://magento.com/security/patches/supee-9767', 'https://magento.com/security/patches/supee-9767', 0, 0),
(169, 2, '2017-06-13 18:20:53', 'New Patch for PayPal Instant Payment Notification (IPN) Changes. Upgrade to 1.9.3.3 or SUPEE-8167 by June 30, 2017 to Avoid Service Disruptions – 6/13/2017', 'As of June 30, 2017, PayPal Instant Payment Notifications will no longer allow you to use HTTP to post messages back to PayPal for verification. To comply with these changes, all merchants using PayPal must upgrade to Community Edition 1.9.3.3 or apply the SUPEE-8167 patch. Updates must be in place by June 30, 2017 to avoid any service disruptions. The patch is available on the Community Edition Download Page (https://magento.com/tech-resources/download) and more information is available from PayPal at https://www.paypal-knowledge.com/infocenter/index?page=content&widgetview=true&id=FAQ1916&viewlocale=en_US\n\n', 'https://magento.com/tech-resources/download ', 0, 0),
(170, 4, '2017-07-05 09:25:37', 'Magento Business Intelligence Essentials: Now Available!', 'Magento Business Intelligence Essentials (BI) helps you and your teams to stay on top of the most important metrics to your business. Essentials works directly with your Magento order and customer data, and provides business insights far beyond what standard web analytics tools provide.\n\nWith Essentials, you can get up and running in only a few minutes and access over 75 pre-built reports instantly. Plus, it comes with a free 7-day trial where no credit card information is required. If you decide to stay, Essentials starts at just $100/month.\n\nFor more information, visit magento.com/products/business-intelligence/essentials.\n', 'https://magento.com/products/business-intelligence/essentials', 0, 0),
(171, 1, '2017-07-12 18:15:32', 'Community Edition 1.9.3.4 and SUPEE-9767 Version 2 Address Issues with May 31 Security Release', 'Community Edition 1.9.3.4 and SUPEE-9767 v2 (patch) are now available. The new release and updated patch address customer registration and other issues encountered by some merchants when using the original release. Please upgrade as soon as possible to keep your site secure. More information is available in the release notes at  http://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html', 'http://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html', 0, 0),
(172, 2, '2017-09-11 22:52:53', 'USPS Name Change Impacts “First-Class Mail Parcel” Service – 09/11/2017', 'USPS changed their “First-Class Mail Parcel” Service to “First-Class Package Service – Retail.” Merchants offering this service must change the name, as “First-Class Mail Parcel” will no longer work. Patches addressing this issue are available on the Magento Open Source download page. More information about the issue is available in a Technical Bulletin at http://devdocs.magento.com/guides/v2.1/release-notes/tech_bull_USPS-patch-Sept2017.html ', 'http://devdocs.magento.com/guides/v2.1/release-notes/tech_bull_USPS-patch-Sept2017.html ', 0, 0),
(173, 1, '2017-09-15 17:50:16', 'Magento Open Source 1.9.3.6 and SUPEE-10266 Security Enhancements – 9/14/2017', 'Magento Open Source 1.9.3.6 and SUPEE-10266 include critical security enhancements. Please update your site as soon as possible. More information is available in the release notes: \nhttp://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html.\n', 'http://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html', 0, 0),
(174, 4, '2017-09-26 22:42:02', 'Magento Open Source 2.2 Delivers Enhanced Commerce Capabilities – 9/26/2017', 'Magento Open Source 2.2 includes a range of platform enhancements, including a new deployment process that minimizes production downtime, optimized performance, platform updates that improve developer experience, and Magento Social marketing tools. Learn more at http://devdocs.magento.com/guides/v2.2/release-notes/bk-release-notes.html.\n\n', 'http://devdocs.magento.com/guides/v2.2/release-notes/bk-release-notes.html ', 0, 0),
(175, 4, '2017-10-17 13:09:36', 'Join us for an exclusive B2B merchant event in Chicago!', 'Transform your business at the Magento B2B Experience on November 2 in Chicago. \n\nNetwork with industry leaders, B2B merchants, and partners to gain insights on B2B best practices, and to discover how to create powerful buyer experiences using Magento to boost your growth. RSVP today! \n\nRegister for free at https://b2bexperience.magento.com\n\nNote: This is a merchant-only event.\n', 'https://b2bexperience.magento.com', 0, 0);

