(10, 'Revitalization process', 'one_column', NULL, NULL, 'revitalization-process', NULL, '<div class="title-heading">\r\n<h1>The</h1>\r\n<h2>Revitalization</h2>\r\n<p class="title-img"><img src="{{config path="web/unsecure/base_url"}}skin/frontend/theme9196/default/images/heading-border.png" /></p>\r\n</div>\r\n<p></p>\r\n<p>Cash Your Bundles only accepts the highest quality and gently used hair. This hair goes through our patent pending sanitization and revitalization method to bring them back to a brand new condition.</p>\r\n<p>Wefts are cut from the hair and discarded. Afterwards, we thoroughly cleanse and condition the hair using our proprietary detoxing process that is both gentle and effective.</p>\r\n<p>Lastly, a brand new weft is placed to bind a new beautiful bundle.</p>', '2017-06-01 06:28:15', '2017-07-14 06:06:11', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(11, 'Quality promise', 'one_column', NULL, NULL, 'quality-promise', NULL, '<div class="title-heading">\r\n<h1>Our</h1>\r\n<h2>Quality Promise</h2>\r\n<p class="title-img"><img src="{{config path="web/unsecure/base_url"}}skin/frontend/theme9196/default/images/heading-border.png" /></p>\r\n</div>\r\n<p></p>\r\n<p>Our top priority is bringing you beautiful and quality hair. The hair you receive has been screened, treated with the utmost care, and packaged to be amazing for you. We only accept the best, to bring you the most. If for some reason you feel we have fallen short of our promise please e-mail <a href="mailto:returns@cashyourbundles.com">returns@cashyourbundles.com</a>.</p>', '2017-06-01 06:29:12', '2017-07-13 05:28:03', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
