INSERT INTO `faq` (`faq_id`, `question`, `answer`, `answer_html`, `creation_time`, `update_time`, `is_active`, `position`) VALUES
(1, 'Where are you located? ', '<p><span style="font-size: medium;">Cash Your Bundles is headquartered in South Florida, but the magic of the internet makes it possible to make Bundlenaires across the country.&nbsp;</span></p>', 0, '2017-06-29 00:00:00', '2017-06-29 07:23:19', 1, 1),
(2, 'What is a Bundlenaire?', '<p><span style="font-size: medium;">A Bundlenaire is someone who has made their bundles make cents! They made some extra cash off bundles they weren&rsquo;t using, or secured some top of the line hair at an affordable price. </span></p>\r\n<p><span style="font-size: medium;">Bundlenaire sellers earn cash on every sold bundle and Bundlenaire buyers get beautiful hair while keeping some money in their pocket. Either way, they found a way to make hair economical-- making them a certified Bundlenaire!&nbsp;</span></p>\r\n<p></p>', 0, '2017-06-16 10:07:18', '2017-06-29 07:23:09', 1, 2),
(3, 'What is virgin hair?', '<p><span style="font-size: medium;">Virgin Hair is hair that has not been dyed, bleached, permed, straightened or chemically treated in any way. Unless otherwise noted, all of our hair is in its natural state when cut and guaranteed to be in correct cuticle alignment.&nbsp;</span></p>', 0, '2017-06-16 10:07:43', '2017-06-29 07:22:59', 1, 3),
(4, 'What is your return policy?', '<p><span style="font-size: medium;">All unused merchandise, unless otherwise indicated, may be refunded within 7 calendar days (for US Continental orders) or within 14 calendar days (for International or US military installation orders) from the original invoice date. All items and packaging must be returned in their original condition.&nbsp;</span></p>', 0, '2017-06-16 10:08:06', '2017-06-29 07:22:49', 1, 4),
(5, 'Can I pick up my order?', '<p><span style="font-size: medium;">Not at this time, but look out for a Cash Your Bundles Pop-up Event near you!&nbsp;</span></p>', 0, '2017-06-29 06:28:49', '2017-06-29 07:22:36', 1, 5),
(6, 'How big is a bundle?', '<p><span style="font-size: medium;">Each of our bundles are approximately 4.0 ounces&nbsp;</span></p>', 0, '2017-06-29 06:29:11', '2017-06-29 07:22:25', 1, 6),
(7, 'ow many bundles do I need to order?', '<p><span style="font-size: medium;">Typically you need 2-3 bundles for a full head.</span></p>', 0, '2017-06-29 06:29:35', '2017-06-29 07:22:14', 1, 7),
(8, 'What happens to the gently used bundles?', '<p><span style="font-size: medium;">Please see our Revitalization Process(link)</span></p>', 0, '2017-06-29 06:30:21', '2017-06-29 07:22:02', 1, 8);

